import React from 'react';

const contentContext = React.createContext({
  front: [
    {
      id: 1, title: 'Développeur Front-End', content: [
        { id: 1, name: 'HTML' },
        { id: 2, name: 'CSS' },
        { id: 3, name: 'Javascript' },
        { id: 4, name: 'React' },
        { id: 5, name: 'Ruby' },
        { id: 6, name: 'Rails' },
      ]
    }
  ],
  back: [
    {
      id: 1, title: 'Marketing Digital', links: [
        { id: 1, name: 'SEO' },
        { id: 2, name: 'SEA' },
        { id: 3, name: 'Email Marketing' },
        { id: 4, name: 'Marketing de contenu' },
      ]
    }
  ],
  marketing: [
    {
      id: 1, title: 'Traduction', links: [
        { id: 1, name: 'Français' },
        { id: 2, name: 'Anglais' },
        { id: 3, name: 'Hollandais' },
      ]
    }
  ],
});

export default contentContext
